var bumpFS = "" +
        "precision highp float;" +
        "varying vec2 fTexCoord;" +
		"varying vec3 fNormal;" +
		"varying vec3 fPosition;" +
		"varying mat4 mvMatrix;" +
        "uniform sampler2D uTexture;" +
	  "const vec3  lightV    = vec3(0.0,0.0,1.0);" +
      "const float lightI    = 1.0;" +
      "const float ambientC  = 0.15;" +
      "const float diffuseC  = 0.6;" +
      "const float specularC = 1.0;" +
      "const float specularE = 100.0;" +
      "const vec3  lightCol  = vec3(1.0,1.0,1.0);" +
      "const vec3  objectCol = vec3(1.0,0.6,0.0);" +
      "vec2 blinnPhongDir(vec3 lightDir, vec3 n, float lightInt, float Ka," +
        "float Kd, float Ks, float shininess) {" +
        "vec3 s = normalize(lightDir);" +
        "vec3 v = normalize(-fPosition);" +
        "vec3 h = normalize(v+s);"+
        "float diffuse = Ka + Kd * lightInt * max(0.0, dot(n, s));" +
        "float spec =  Ks * pow(max(0.0, dot(n,h)), shininess);" +
        "return vec2(diffuse, spec);" +
      "}" +
        "void main(void) {" +
        "vec3 rgbNormal=texture2D(uTexture,fTexCoord).xyz;" +
		"vec3 nMapped = normalize(rgbNormal + fNormal);" +
        "vec3 n = (mvMatrix * vec4(nMapped, 0.0)).xyz;" +
        "vec3 ColorS  = blinnPhongDir(lightV,n,0.0   ,0.0,     0.0,     specularC,specularE).y*lightCol;" +
        "vec3 ColorAD = blinnPhongDir(lightV,n,lightI,ambientC,diffuseC,0.0,      1.0      ).x*vec3(.25, .8, .8);" +
        "gl_FragColor = vec4(ColorAD+ColorS,1.0);" +
        "}";
		
var decalFS = "" +
        "precision highp float;" +
        "varying vec2 fTexCoord;" +
		"varying vec3 fNormal;" +
		"varying vec3 fPosition;" +
		"varying mat4 mvMatrix;" +
        "uniform sampler2D uTexture;" + 
		"uniform sampler2D u2Texture;" +
		"uniform sampler2D u3Texture;" +
        "void main(void) {" +
        "vec3 texColor = texture2D(uTexture,fTexCoord).xyz;" +
		"vec3 bgColor = texture2D(u3Texture, fTexCoord).xyz;" +
		"float opacity = texture2D(u2Texture,fTexCoord).a;" + 
		"gl_FragColor = vec4(texColor, 1.0);" +
		"if (opacity == 0.0)" +
		"gl_FragColor = vec4(.5*bgColor, 1.0);" +
        "}";

